import r1 from "../src/images/r1.jpg";
import r2 from "../src/images/r2.jpg";
import r3 from "../src/images/r3.png";
import r4 from "../src/images/r4.jpg";
import r5 from "../src/images/r5.png";
import r6 from "../src/images/r6.png";

const Sdata=[
    {imgsan:r1,title:"Image1"},
    {imgsan:r2,title:"Image2"},
    {imgsan:r3,title:"Image3"},
    {imgsan:r4,title:"Image4"},
    {imgsan:r5,title:"Image5"},
    {imgsan:r6,title:"Image6"}
];
